import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faBell, faUser } from '@fortawesome/free-solid-svg-icons';

const Header = () => {
  return (
    <header className="w-full bg-white shadow py-4 px-6 flex justify-between items-center">
      <div className="flex items-center">
        <h1 className="text-2xl font-semibold text-gray-800">Welcome To Dashboard</h1>
        <div className="mx-4 text-gray-400">|</div>
        <p className="text-gray-600">Early Fire Prediction</p>
      </div>
      <div className="flex items-center space-x-4">
        {/* Search bar */}
        <div className="relative">
          <input
            type="search"
            className="bg-gray-200 h-10 px-5 pr-10 rounded-full text-sm focus:outline-none"
            placeholder="Search here..."
          />
          <FontAwesomeIcon icon={faSearch} className="absolute right-0 top-0 mt-3 mr-4 text-gray-500" />
        </div>
        {/* Notification and profile icons */}
        <FontAwesomeIcon icon={faBell} className="text-gray-500" />
        <FontAwesomeIcon icon={faUser} className="text-gray-500" />
      </div>
    </header>
  );
};

export default Header;
